import React from "react";
import { Route, Redirect } from "react-router-dom";

function PublicRoute({ component: Component, authenticated, ...rest }) {
  return (
    <Routes
      {...rest}
      render={(props) =>
        authenticated === false ? (
          <Component {...props} />
        ) : (
          <Route path="/" element={<Navigate replace to="/chat"/>} />
        )
      }
    />
  );
}

export default PublicRoute;
